import React from 'react';
import './App.css';
// import Trading from './Components/Trading';
// import TradingTwo from './Components/TradingTwo';
import Blx from './Components/Blx';
import Shorts from './Components/Shorts';
import Scalp from './Components/Scalp';
import ScalpBtc from './Components/ScalpBBtc';

import { useState } from 'react'

function App() {

    const [isToggleOn, setToggle] = useState(true)
    const [isToggleOnTwo, setToggleTwo] = useState(true)
    const [isToggleOnThree, setToggleThree] = useState(true)
    const [isToggleOnFour, setToggleFour] = useState(true)

   const hanClick = () => {
        setToggle( isToggleOn  ? false : true)
      }

    const hanClickTwo = () => {
      setToggleTwo( isToggleOnTwo  ? false : true)
    }


    const hanClickThree = () => {
      setToggleThree( isToggleOnThree  ? false : true)
    }

    const hanClickFour = () => {
      setToggleFour( isToggleOnFour  ? false : true)
    }

    const hanClickFive = () => {
      setToggleFive( isToggleOnFive  ? false : true)
    }


return (

<div className="App">
<div className="Navbar">

<a onClick={hanClick}>Daily</a>
<a onClick={hanClickTwo}>BLX</a>
<a onClick={hanClickThree}>Shorts</a>
<a onClick={hanClickFour}>Scalping Charts ETH</a>
<a onClick={hanClickFive}>Scalping Charts BTC</a>
<a target="_blank" href="https://coinfarm.online/index.asp?tcs=1h">CoinFarm</a>
<a target="_blank" href="https://coinmarketcap.com/">CMC</a>
<a target="_blank" href="https://coinmarketcap.com/">Bitfinex</a>


<a target="_blank" href="http://data.bitcoinity.org/markets/bidask_sum/7d/USD/coinbase?bp=5&bu=c&t=m"> Bids vs Sums</a>
<a href="#contact">Trades and current TA</a>
</div >

{isToggleOnTwo ? false : <Blx/>}
{isToggleOnFour ? false : <Scalp/>}
{isToggleOnFive ? false : <ScalpBtc/>}
{isToggleOnThree ? false : <Shorts/>}

{/* {isToggleOn ? 'ON' : <TradingTwo/>} */}
{/* <Trading/> */}          
{/* <TradingTwo/> */}

</div>

);
}

export default App;
